import React, { useState } from "react";

export default function Volunteers() {
    const [volunteers, setVolunteers] = useState([
        { id: 1, name: "Ion Popescu", email: "ion@email.com" },
        { id: 2, name: "Maria Ionescu", email: "maria@email.com" },
    ]);

    const handleDelete = (id) => {
        setVolunteers(volunteers.filter(v => v.id !== id));
    };

    return (
        <div className="content-section active">
            <h2>Voluntari</h2>

            {volunteers.length === 0 ? (
                <p>Nu există voluntari.</p>
            ) : (
                <div className="volunteers-list">
                    {volunteers.map(v => (
                        <div key={v.id} className="volunteer-card">
                            <h3>{v.name}</h3>
                            <p>{v.email}</p>
                            <button className="btn-delete" onClick={() => handleDelete(v.id)}>Șterge</button>
                        </div>
                    ))}
                </div>
            )}
        </div>
    );
}
